import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <h1>Hello!</h1>
      <p>This is a paragraph.</p>
      <img src="http://pages.cpsc.ucalgary.ca/~carey/CPSC441/ass1/Floppy.jpg" alt="My boy Floppy" width="200" height="300"/>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
